    justify-content: space-between;
    @media (max-width: 768px) {
      color: red;
    }
  `;

  const NavItem = styled.div`
    padding: 2px 30px;
    display: grid;
    place-items: center;
    background-color: #2B2C2B;
    @media (max-width: 768px) {
      color: red;
    }
  `;

  const Logo = styled.p`
    color: #88BBBC;
