  display: flex;
  flex-direction: row;
  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

    return (
      <nav>
        <div className="nav-item nav-logo">
          <Link to='/'><p className="logo">Alanna Mathieu</p></Link>
        </div>
        <div className="nav-item">
          <ToggleButton/>
        </div>
      </nav>
    );


}

export default Nav;
